import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { useHistory } from 'react-router-dom'
import './view.css'

const View = () => {
    const history = useHistory()
    const user = localStorage.getItem('userID')

    const [userdata, setUserdata] = useState()
    console.log('hello edflkemf', typeof user)
    useEffect(() => {
        axios.get('http://localhost:1337/item')
            .then((response) => {
                console.log('jwvhfcjmkj',user)
                 if(user==response.data[0].userId.id){
                     setUserdata(response.data[0])
                 }                   
            }, (err) => {
                console.log(err)
            })
    }, [])

    // const useridFromDB=userdata.userId.id
    console.log("object is here ",userdata.desc)
    // console.log(books.data)
    return (
        <>
            {!user ? (
                <center className="m-5">
                    <h3>Sorry...
                        No user logged in yet.
                    </h3>

                    <h4>Please <a className="text-success" onClick={() => { history.push('/login') }}>click here</a> to login</h4>
                </center>
            ) : (

                userdata.map((book)=>(

                <div class="card" >
                    <img src="book.img" class="card-img-top" alt="..."/>
                    <div class ="card-body">
                    <h5 class ="card-title">{book.title}</h5>
                    <p class ="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="#" class ="btn btn-primary">Go somewhere</a>
                    </div>
                </div>
               ))
            )}
        </>
    )
}

export default View
